import "./Header.scss";
import logo from "./../../img/computadora.png";
import carrito from "./../../img/carrito.png";
import hacker from "./../../img/hacker.png";

function Header() {
  return (
    <header class="header">
        <img src={logo} class="header-logo"></img>

        <nav class="header-navegation">
            <li class="header-navegation_menu"><a href="#">Ropa</a></li>
            <li class="header-navegation_menu"><a href="#">merchandising</a></li>
            <li class="header-navegation_menu"><a href="#">Ordenadores</a></li>
        </nav>

        <form action="#" class="header-search">
            <input type="text" class="header-search__input"></input>
            <button class="header-search__button">B</button>
        </form>

        <div class="header-user">
            <div class="header-user__cesta">
                <img src={carrito} class="header-user__cesta"></img>
            </div>
            <div class="header-user__user">
                <img src={hacker} class="header-user__cesta"></img>
            </div>
        </div>

    </header>
  );
}

export default Header;
